import "./styles.css";

export default function BankAccount(){

    const initialState = {
        balance: 0,
        loan: 0,
        isActive: false
    };

    return(
        <>
            <h3>Bank Account</h3><br/>

            <div className="App">

                <div>
                    <p>Balance: X</p>
                    <p>Loan: X</p>
                </div><br/>

                <p><button>Open account</button></p>
                <p><button>Withdraw 50</button></p><br/>

                <p><button>Request a loan of 5000</button></p>
                <p><button>Pay loan</button></p><br/>
                
                <p><button>Cloase account</button></p><br/>

            </div>
        </>
    )
}
